    render() {
        return (
            <div>
                    <div className='input-container'>
                            <label>Search For a Movie</label>
                            <input type='text'/>
                    </div>

                       <div className='movies-container'>
                           
                                       <Movie title='dark knight'/>
                                       <Movie title='Fight Club'/>
                                       <Movie title='Spiderman'/>
                       </div>     



                    


                   
                    
            </div>
        )
    }
}
